import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import Hamburger from './img/hamburger-menu-white.svg'
import Temple from './img/header-image.png'

function Header() {
    return (
        <div>
            <img 
                src={Temple}
                size="30%"
            ></img>
        </div>
    )
}

function NavbarLogin() {
    return (
        <span class="navbar-child" id="login-span">
            <button id="login">
            </button>
        </span>
    )
}

function NavbarHamburger() {
    return (
        <span class="navbar-child">
            <button id="hamburger">
            </button>
        </span>
    )
}

function NavbarTitle() {
    return (
        <span class="navbar-child" id="navbar-title">
            Museum
        </span>
    )
}

function Navbar() {
    return (
        <div class="navbar-main navbar-position">
            <NavbarHamburger />
            <NavbarTitle />
            <NavbarLogin />
        </div>
    )
}

ReactDOM.render(
    [
        <Navbar />,
        <Header />
    ],
    document.getElementById('root')
);
